import React from "react";

class Getrid extends React.Component{
    render() {
        return(
            <div>
                <h2>Get rid of</h2>
                <h2>stuff</h2>
                <div>Give things you no longer use</div>
                <div>to the ones in need by</div>
                <div>requesting our free pickup</div>
                <div>service</div>
                <button>Get Started</button> <button>Learn More</button>
            </div>
        );
     }
}

export default Getrid;
